const DeleteGHI = async (country, year, refreshData) => {
  try {
    const response = await fetch(
      `https://6743ce15b7464b1c2a65e803.mockapi.io/GHI?country=${country}&year=${year}`,
      { method: 'DELETE' }
    );

    if (response.ok) {
      console.log('삭제 성공');
      refreshData();
    } else {
      console.error(`삭제 실패: ${response.status}`);
    }
  } catch (error) {
    console.error('삭제 요청 중 오류 발생:', error);
  }
};

export default DeleteGHI;
